import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Form, Spinner, Alert, Card, Accordion } from 'react-bootstrap';
import { FaSearch } from 'react-icons/fa';

const VINSearch = () => {
  const [vin, setVin] = useState('');
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSearch = async () => {
    if (!vin.trim()) {
      setError('Please enter a valid VIN.');
      return;
    }
    setError('');
    setLoading(true);

    try {
      const response = await fetch(
        `https://vpic.nhtsa.dot.gov/api/vehicles/decodevin/${vin}?format=json`
      );
      const result = await response.json();
      if (result.Results && result.Results.length > 0) {
        setData(result.Results);

        // Mock vehicle data structure for Garage integration
        const mockVehicleData = {
          make:
            result.Results.find((item) => item.Variable === 'Make')?.Value ||
            'N/A',
          model:
            result.Results.find((item) => item.Variable === 'Model')?.Value ||
            'N/A',
          year:
            result.Results.find((item) => item.Variable === 'Model Year')
              ?.Value || 'N/A',
          vin: vin,
          registrationStatus: 'Active', // Default value
          mileage: 0, // Default value
          specifications: {
            make:
              result.Results.find((item) => item.Variable === 'Make')?.Value ||
              'N/A',
            model:
              result.Results.find((item) => item.Variable === 'Model')?.Value ||
              'N/A',
            year:
              result.Results.find((item) => item.Variable === 'Model Year')
                ?.Value || 'N/A',
            trim:
              result.Results.find((item) => item.Variable === 'Series')
                ?.Value || 'N/A',
            madeIn:
              result.Results.find((item) => item.Variable === 'Plant Country')
                ?.Value || 'N/A',
            steeringType:
              result.Results.find((item) => item.Variable === 'Steering Type')
                ?.Value || 'N/A',
            fuelType:
              result.Results.find(
                (item) => item.Variable === 'Fuel Type - Primary'
              )?.Value || 'N/A',
            grossWeight:
              result.Results.find(
                (item) => item.Variable === 'Gross Vehicle Weight Rating'
              )?.Value || 'N/A',
            overallLength:
              result.Results.find((item) => item.Variable === 'Overall Length')
                ?.Value || 'N/A',
            standardSeating:
              result.Results.find(
                (item) => item.Variable === 'Seating Capacity'
              )?.Value || 'N/A',
            highwayMileage:
              result.Results.find(
                (item) => item.Variable === 'Fuel Economy - Highway'
              )?.Value || 'N/A',
            invoicePrice: 'N/A', // Not available in the API
            engine:
              result.Results.find(
                (item) => item.Variable === 'Engine Number of Cylinders'
              )?.Value || 'N/A',
            style:
              result.Results.find((item) => item.Variable === 'Body Class')
                ?.Value || 'N/A',
            antiBrakeSystem:
              result.Results.find(
                (item) => item.Variable === 'Brake System Type'
              )?.Value || 'N/A',
            fuelCapacity:
              result.Results.find((item) => item.Variable === 'Fuel Capacity')
                ?.Value || 'N/A',
            overallHeight:
              result.Results.find((item) => item.Variable === 'Overall Height')
                ?.Value || 'N/A',
            overallWidth:
              result.Results.find((item) => item.Variable === 'Overall Width')
                ?.Value || 'N/A',
            optionalSeating: 'N/A', // Not available in the API
            cityMileage:
              result.Results.find(
                (item) => item.Variable === 'Fuel Economy - City'
              )?.Value || 'N/A',
            msrp: 'N/A', // Not available in the API
          },
          titleRecords: [], // Default value
          junkSalvageRecords: [], // Default value
          saleRecords: [], // Default value
          problemChecks: {
            floodDamage: 'No problems found!',
            fireDamage: 'No problems found!',
            hailDamage: 'No problems found!',
            saltWaterDamage: 'No problems found!',
            vandalism: 'No problems found!',
            rebuilt: 'No problems found!',
            salvageDamage: 'No problems found!',
          },
        };

        // Navigate to Garage page with the vehicle data
        navigate('/garage', { state: { vehicle: mockVehicleData } });
      } else {
        setError('No data found for this VIN.');
      }
    } catch (err) {
      setError('Failed to fetch data. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container mt-5 pt-5">
      <h2 className="text-center mb-4 fw-bold text-primary">
        <FaSearch className="me-2" /> VIN Search
      </h2>

      {/* Search Bar */}
      <Form
        onSubmit={(e) => {
          e.preventDefault();
          handleSearch();
        }}
      >
        <div className="input-group mb-3">
          <Form.Control
            type="text"
            placeholder="Enter VIN"
            value={vin}
            onChange={(e) => setVin(e.target.value)}
            aria-label="Enter VIN"
            aria-describedby="search-button"
            style={{
              borderTopRightRadius: '0',
              borderBottomRightRadius: '0',
              border: '2px solid #007bff',
              minHeight: '48px',
              lineHeight: '1.5',
              transition:
                'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
            }}
            onFocus={(e) => {
              e.target.style.transform = 'scale(1.02)';
              e.target.style.boxShadow = '0 4px 8px rgba(0, 123, 255, 0.2)';
            }}
            onBlur={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = 'none';
            }}
          />
          <Button
            variant="primary"
            id="search-button"
            onClick={handleSearch}
            disabled={loading}
            style={{
              borderTopLeftRadius: '0',
              borderBottomLeftRadius: '0',
              padding: '0.5rem 1.5rem',
              fontSize: '1rem',
              fontWeight: 'bold',
              minHeight: '48px',
              transition:
                'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 4px 8px rgba(0, 123, 255, 0.2)';
            }}
            onMouseOut={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = 'none';
            }}
          >
            {loading ? (
              <>
                <Spinner
                  as="span"
                  animation="border"
                  size="sm"
                  role="status"
                  aria-hidden="true"
                  className="me-2"
                />
                Searching...
              </>
            ) : (
              'Search'
            )}
          </Button>
        </div>
      </Form>

      {/* Error Message */}
      {error && (
        <Alert variant="danger" className="text-center">
          {error}
        </Alert>
      )}

      {/* Display Results */}
      {data && (
        <Card className="mt-4 shadow-sm">
          <Card.Body>
            <h3 className="text-primary">Results:</h3>
            <Accordion>
              {data.map((item, index) => (
                <Accordion.Item key={index} eventKey={index.toString()}>
                  <Accordion.Header>
                    {item.Variable}: {item.Value}
                  </Accordion.Header>
                  <Accordion.Body>
                    <pre>{JSON.stringify(item, null, 2)}</pre>
                  </Accordion.Body>
                </Accordion.Item>
              ))}
            </Accordion>
          </Card.Body>
        </Card>
      )}
    </div>
  );
};

export default VINSearch;
